import "./App.css";
import { useState } from "react";

function Unit({ unitCode, title }) {
    const [unitName, setUnitName] = useState(title);

    const click = () => {
        setUnitName(title.toUpperCase());
    };

    return (
        <div onClick={click}>
            {unitCode}: {unitName}
        </div>
    );
}

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <Unit
                    unitCode={"COMP3120"}
                    title={"Advanced Web Developmen"}
                ></Unit>
            </header>
        </div>
    );
}

export default App;
